Δεδομένου ότι Οι 5,539 αποφοίτοι της νομικής σχολής αποτελούν μια διακεκριμένη ομάδα. Επομένως, πρέπει να ισχύει ότι "Η νομική σχολή ήταν ανοικτή για 100 χρόνια και είχε 5.539 αποφοίτους."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Δεν θα πάρουν τα μυαλά μου αέρα από αυτά που είπε ο Wolverstone. Επομένως, πρέπει να ισχύει ότι "Ένιωσα πολύ ενθουσιασμένος από τα λόγια του Wolverstone."; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Πολλοί μικροί ναοί βρίσκονται εδώ. Επομένως, πρέπει να ισχύει ότι "Υπάρχουν μερικοί μικροί ναοί που μόνο ένα άτομο μπορεί να χωρέσει."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Επομένως, πρέπει να ισχύει ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
